from ape import accounts, project 


# ape run  DEPLOY_testDeployNFT   --network ethereum:sepolia:foundry


# test image 
img = ""
mime_type = "image/png"

pixelChan = ""
pixelChan_mime = "image/gif"

finalGif = ''''''


finalGif_mine = "image/jpg"


def main():
    # account = accounts.test_accounts[0]
    account = accounts.load("testnet")
    print(f"using address {account.address}")
    # storage_contract = account.deploy(project.OnchainImg, sender=account, publish=True)
    storage_contract = account.deploy(
    project.OnchainImg,
    sender=account,
    publish=True,
    gas_limit=5_000_000  # Adjust the gas limit
    )
    
    print(f"onchain storage deployed at address: {storage_contract.address}")
    print("Uploading img to contract ")   
    img_id = storage_contract.addImage(mime_type, img,  sender=account, gas_limit=5_000_000)
    img_id = img_id.return_value
    print(f"img id {img_id}")
    # print("Uploading img to contract ")
    # img_id = storage_contract.addImage(mime_type, img, sender=account)
    # img_id = img_id.return_value
    # print(f"img id {img_id}")
    
    nft_contract = account.deploy(project.NFTWithOnchainImg, storage_contract.address,  sender=account, publish=True)

    #  mintNFT(address to, uint256 imageId)
    print(f"nft deployed at address: {nft_contract}")
    nft = nft_contract.mintNFT(account.address,img_id, sender=account )

    img_id = storage_contract.addImage(pixelChan_mime, pixelChan,  sender=account, gas_limit=5_000_000)
    img_id = img_id.return_value
    print(f"img id {img_id}")
    nft = nft_contract.mintNFT(account.address,img_id, sender=account )


    img_id = storage_contract.addImage(finalGif_mine, finalGif,  sender=account, gas_limit=5_000_000)
    img_id = img_id.return_value
    print(f"img id {img_id}")
    nft = nft_contract.mintNFT(account.address,img_id, sender=account, gas_limit=5_000_000)





